e6-5921-e66a7c9d-a8ef-c39406c7f446;11e6-5922-01d9a64f-a8ef-c39406c7f446;11e6-5ab2-4bbd151d-8aa4-492439a6c07c;11e6-5dda-45d3c96f-85f7-cf9d3b122d63;11e6-5dde-b4911ac8-85f7-cf9d3b122d63;11e6-5e07-f5a7692d-ae15-3d6b584ebd70;11e6-5e9e-2c95febe-b0f0-d3a532217234','<p style=\"white-space: normal;\"> 为感谢全体员工为公司发展所付出的不懈努力，增强员工的凝聚力，丰富集体生活，让员工在繁忙的工作中放松身心，以更饱满的精神更积极的态度面对生活，面对工作。也为了增进同事之间的交流与沟通。经公司领导同意，特组织全体员工到广州长隆欢乐世界一天游。凡属博世机电设备公司在职员工，均可免费享受此福利。</p><p style=\"white-space: normal;\">旅游相关事宜如下：</p><p style=\"white-space: normal;\">一、活动时间：2016年5月24日（活动为期一天）。</p><p style=\"white-space: normal;\">二、活动地点： 广州长隆欢乐世界</p><p style=\"white-space: normal;\">三、参加人员：博世机电全体员工（包括新入职员工）。</p><p style=\"white-space: normal;\">四、旅游费用：本次旅游作为公司福利，费用由公司承担。如有带朋友或亲属的，请自费大概是300元/人。</p><p style=\"white-space: normal;\">五、活动要求：</p><p style=\"white-space: normal;\">  1、集合时间：2016年05月24日，早上7点</p><p style=\"white-space: normal;\">  2、集合地点：公司门前 </p><p style=\"white-space: normal;\">六：注意事项：</p><p style=\"white-space: normal;\">    1.为了有一个美好快乐的旅游行程，各部门旅游人员在出发前做好自己所负责的各项工作；</p><p style=\"white-space: normal;\">    2.为预防万一，大家需带好个人身份证或相关的有效证件；</p><p style=\"white-space: normal;\">    3.为保证旅游活动的安全、顺利进行，全体参加旅游人员必须遵守纪律，服从公司相关规定，不得脱离团队单独行动；</p><p style=\"white-space: normal;\">    4.在游玩过程中注意个人财务及人身安全，做到文明、安全、快乐、顺利出游；</p><p style=\"white-space: normal;\">    5.晕车员工请自带晕车药及方便袋，注意防晒。</p><p style=\"white-space: normal;\">    6.因天气变化无常，请大家自备雨具及衣物。</p><p style=\"white-space: normal;\">   </p><p style=\"white-space: normal;\">    最后，预祝所有伙伴游的开心！玩的快乐！</p><p style=\"white-space: normal;\"><br/></p><p><br/></p>','11e6-6b63-c0e0f068-ab37-bf0a0f2138df','11e3-8a58-82144b41-9194-1d682b48d529',NULL);
